import React from "react";
import { Grid } from "@mui/material";

const DayDraggable = (props) => {
    return (
        <Grid container border={1}>
            <Grid item>
                <h3>{props.title}</h3>
            </Grid>
            <Grid alignItems={'center'}>
                {props.description}
            </Grid>
        </Grid>
    )
}

export default DayDraggable;
